

CREATE TABLE `op_bill` (
  `pid` int(11) NOT NULL,
  `billid` int(11) NOT NULL AUTO_INCREMENT,
  `opon` varchar(11) NOT NULL,
  `bed` int(11) DEFAULT NULL,
  `ot` int(11) DEFAULT NULL,
  `anesthetic` int(11) DEFAULT NULL,
  `surgeon` int(11) DEFAULT NULL,
  `assistant` int(11) DEFAULT NULL,
  `laurettecassette` int(11) DEFAULT NULL,
  `lauretteexpenses` int(11) DEFAULT NULL,
  `iolworkup` int(11) DEFAULT NULL,
  `medicine` int(11) DEFAULT NULL,
  `intra` int(11) DEFAULT NULL,
  `total` int(11) DEFAULT NULL,
  `timestamp` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`billid`),
  UNIQUE KEY `pid` (`pid`),
  CONSTRAINT `op_patient_id` FOREIGN KEY (`pid`) REFERENCES `op_patient` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1112 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `op_discharge` (
  `pid` int(11) NOT NULL,
  `diagnosis` varchar(80) NOT NULL,
  `surgeryprocedure` varchar(80) NOT NULL,
  `doa` varchar(11) NOT NULL,
  `doatime` varchar(10) NOT NULL,
  `dos` varchar(11) NOT NULL,
  `dod` varchar(11) NOT NULL,
  `dodtime` varchar(10) NOT NULL,
  `timestamp` timestamp NOT NULL DEFAULT current_timestamp(),
  KEY `op_patient_id_dis` (`pid`),
  CONSTRAINT `op_patient_id_dis` FOREIGN KEY (`pid`) REFERENCES `op_patient` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




CREATE TABLE `op_patient` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pre` varchar(4) NOT NULL,
  `fullname` varchar(50) NOT NULL,
  `pref` varchar(4) NOT NULL,
  `fathersname` varchar(50) NOT NULL,
  `gender` varchar(1) NOT NULL,
  `age` int(3) NOT NULL,
  `address` varchar(50) NOT NULL,
  `email` varchar(45) NOT NULL,
  `phone` bigint(11) NOT NULL,
  `timestamp` timestamp NOT NULL DEFAULT current_timestamp(),
  `idstatus` varchar(11) DEFAULT 'Active',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11112 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `patient_treatment` (
  `id` int(255) NOT NULL AUTO_INCREMENT,
  `f_pre` varchar(4) NOT NULL,
  `name` varchar(50) NOT NULL,
  `dob` varchar(11) NOT NULL,
  `gender` varchar(25) NOT NULL,
  `checkup_no` int(11) DEFAULT NULL,
  `rdate` varchar(25) NOT NULL,
  `payment` varchar(7) NOT NULL,
  `chno` varchar(15) NOT NULL,
  `oct` varchar(7) NOT NULL,
  `ffa` varchar(7) NOT NULL,
  `prp` varchar(7) NOT NULL,
  `noprp` int(1) DEFAULT NULL,
  `sectoral` varchar(7) NOT NULL,
  `nosectoral` int(1) DEFAULT NULL,
  `barrage` varchar(7) NOT NULL,
  `nobarrage` int(1) DEFAULT NULL,
  `yaglaser` varchar(7) NOT NULL,
  `bscan` varchar(7) NOT NULL,
  `fphoto` varchar(7) NOT NULL,
  `cct` varchar(7) NOT NULL,
  `perimetry` varchar(7) NOT NULL,
  `yagpi` varchar(7) NOT NULL,
  `antivegf` varchar(5) NOT NULL,
  `ranieyeinj` varchar(7) NOT NULL,
  `rajumabinj` varchar(7) NOT NULL,
  `glaucomaworkup` varchar(7) NOT NULL,
  `iolworkup` varchar(7) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=111116 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `patients` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `f_pre` varchar(4) NOT NULL,
  `name` varchar(50) NOT NULL,
  `dob` varchar(11) NOT NULL,
  `gender` varchar(1) NOT NULL,
  `checkup_no` int(3) DEFAULT NULL,
  `rdate` varchar(11) NOT NULL,
  `payment` varchar(7) NOT NULL,
  `chno` varchar(15) NOT NULL,
  `fee` int(5) NOT NULL,
  `email` varchar(40) NOT NULL,
  `phone` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11117495 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `rate` (
  `sno` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(40) NOT NULL,
  `rate` int(6) NOT NULL,
  PRIMARY KEY (`sno`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) NOT NULL,
  `full_name` varchar(30) NOT NULL,
  `password` varchar(255) NOT NULL,
  `emailid` varchar(30) NOT NULL,
  `access_level` varchar(5) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=latin1;


